Undisputed III : Redemption (2010)

Verenigde Staten
Actie
96 minuten

geregisseerd door Isaac Florentine
met Scott Adkins, Mykel Shannon Jenkins en Mark Ivanir

Uri Boyka is een oost-Europeaanse gevangenisvechter. Hij is op 
zoek naar een mogelijkheid om zich de gevangenis uit te vechten, 
maar om dat te bereiken zal hij de beste kooivechters in de wereld 
moeten verslaan.
